import "./expensesList.css";
import ExpenseItem from "./expenseItem";
function ExpensesList(props) {
  let expensesCont = <p>No expenses found!</p>;
  if (props.items.length > 0)
    expensesCont = props.items.map((item) => (
      <ExpenseItem
        key={item.id}
        title={item.title}
        amount={item.amount}
        date={item.date}
      />
    ));
  return expensesCont;
}
export default ExpensesList;
